import React from "react";
import articles from "../data/articles";
import StatusBadge from "../components/StatusBadge";

function MyArticles() {
  return (
    <div>
      <h2>My Articles</h2>
      {articles.map((article) => (
        <div key={article.id} style={{ marginBottom: "15px" }}>
          <h5>{article.title} <StatusBadge status="active" /></h5>
          <p>{article.content}</p>
        </div>
      ))}
    </div>
  );
}

export default MyArticles;
